import React from 'react'

const AttributeExplaination = (props) => {
    return (
        <div>
            {props.industry == true &&
               <CPT0Industry/>
            }
            {props.name === true &&
                <div></div>
            }
            {props.description === true &&
                <div></div>
            }
            {props.startDate === true &&
                <div></div>
            }
            {props.projectionPeriod === true &&
                <div></div>
            }
            {props.currency === true &&
                <div></div>
            }
            {props.taxRate === true &&
                <div></div>
            }
            {props.discountRate === true &&
                <div></div>
            }
            {props.saleTrend === true &&
                <div></div>
            }
            {props.logo === true &&
                <div></div>
            }
        </div>
    )
}

export default AttributeExplaination
